import React from 'react';

const calculatorSummary = (props) => {
    return (
        <div>
            <center><h1>Podsumowanie dla miesiąca {props.monthName}</h1>
                <br></br>
                Wymiar czasu pracy w tym miesiącu: {props.workedHoursInMonth}h, przepracowano: {props.workedHours}h
                Stawka godzinowa (brutto): {props.hourlyFee}zł
                Liczba nadgodzin: {props.overHoursAmount}, wynagrodzenie brutto: 360zł
                Liczba nadgodzin: {props.overHoursAmount}, wynagrodzenie netto: 242,28zł
                Wynagrodzenie całkowite brutto (podstawa + nadgodziny): 2400zł
                Wynagrodzenie całkowite netto (podstawa + nadgodziny): 1615,2zł
            </center>
        </div>
    );
}

export default calculatorSummary;
